deck_description:
This is the most unlikely deck to ever work and it works amazingly

use koaki meiru spell as a combo for the golden lord, main engine is zombie not hard to use, use hunter of black feather + zombie world to remove opponent monsters and throw necessary zombies in the graveyard, use raidraptor-last strix to invoke number 92 or another raidraptor

&nbsp;

Gameplay session : <a class="style-scope ytcp-video-metadata-info" href="https://youtu.be/Prx66Fs879g" target="_blank" rel="noopener noreferrer nofollow">https://youtu.be/Prx66Fs879g</a>

&nbsp;

&nbsp;

Adamatia archetype is focused on excavating cards from the top of the deck to special summon other rock monsters to gain access to synchro monsters and solid backrow cards. Their effect is generic so it allows several gameplans, here I propose a control oriented build. The gameplan will be to maximize the excavating effects of our monsters to summon generic rock monsters and synchro monsters with good control effects when seting a backrow.

&nbsp;

The main deck monsters separates into 2 ccategories : the tuners that special summon themselves to excavate cards and speciel summon monsters amongst them, and the non-tuners that trigger effects when summoned by Adamatia monster's effects. The tuner monsters are the basis of the deck's strategy : they share the effect of excavating the top 5 cards of the deck to special summon a level 4 or lower non-tuner rock monster that was revealed, and can speciel summon themselves by different ways (Adamatia Analyser summons itself if only the opponent controls a monster, Adamatia Seeker summons itself if we control another Adamatia monster and Adamatia Researcher summons itself if we control another rock monster). The other Adamatia monsters shares the effect of sending back any synchro monster of their attribute from the field or graveyard to the extra deck to go back to the top of the deck, and trigger an effect if summoned by an Adamatia monster effect : Leonite can send an Adamatia monster from the hand/graveyard to the top of the deck, Raptite send a rock monster from the hand/graveyard to the top of the deck and Dragite is a 1 card draw. The non-tuner monsters are important to constantly recycle ressources and are an alternative way to place a specific monster on top of the deck so we are sure to special summon it later. The cycling effect is generic so we can recycle monsters like Crystal Wing Synchro Dragon.

To complete this engine we have Koa'ki Meiru Guardian and Koa'ki Meiru Wall that are targets for the adamatia tuner's effect and can negate respectively monsters and spells effect activation. Gigantes is an extender that opens plays on Granite Loyalist to unlock mediocre hands and can break backrows in some specific configurations.

Lastly Ash Blossom pairs with Infinite Impermanence to restrain opponent's play and allow easier OTKs when going second, and can also backup our boards when going first.

&nbsp;

The spell and trap package of the archetype is quite good and polyvalent. First Adamatia Laputite is a field spell that boost all rock monsters to create a fair number of beatsticks and make our boards harder to break (a simple Koa'ki Meiru monster go to 2400 Atk), and has the usefull ability to take 5 Adamatia cards of the deck and place them on top in any order so we can have access to all our cards folowing the situations. Adamatia Sign is a generic reborn for rock monsters that is not once per turn, and can place any Adamatia monster of the deck on it's top if reborning an Adamatia monster. Adamatia Resonance is a counter trap that handles a monster effect and Adamatia Relieve tributes x Adamatia monsters to destroy x+1 cards on the field, being a good disruption effect against many decks.

Lastly Pot Of Avarice is an alternative way to recycle specific cards of the graveyard and draw 2 cards, to search out backrow cards/hand traps after we made our board. It's also an excllent card to start a grind game if the opponent broke our board.

&nbsp;

The extra deck Adamatia monsters also have a shared excavating effect : Raptite excavates thee top 5 cards to special summon any rock monster revealed, Leonite takes 1 revealed Adamatia card to the hand and Dragite bounces x or less cards to the hand, w being the numbr of rock monsters revealed. Adamatia Rise Dragite is a great OTK generator that can get rid of annoying monsters and backrow simultaneously. They also have a quick effect that triggers during the opponent's turn if a monster of their attribute is in our graveyard (mostly the non-tuner Adamatia monsters) : Raptite banishes 1 card from the opponent's graveyard, Leonite reborns a rock monster (usefull to bring back Koa'ki Meiru monsters) and Dragite is a spell/trap negation. Crystal Wing Synchro Dragon and Dragon Ogre Deity Of Tenyi are easy to summon and consist on monster effect negation / banishing disruption that can also highly pressure boards during battlephases.

Granite Loyalist and Abyss Dweller are easy to summon xyz4 monsters, the first can search out any rock monster to unlock bricky hands or extend boards and the second locks the opponent's graveyard to backup our final board, being a stop to specific decks.

The link package is generic. Salamangreat Almiraj is a destruction protection and is also a fire type monster that is easy to summon that enables the quick effect of Adamatia Rise Leonite. Knightmare Phoenix and Unicorn can especially handle backrow cards to OTK if we go second or grind the game in some specific configurations, and Borreload Dragon is a way to bypass annoying monsters like Avramax. Apollousa, Bow Of The Goddess is a good grind game option to prevent monster effects that triggers during the battle phase and push OTKs.

&nbsp;

The side deck :

It's designed to enhance going second match ups, so first twin Twisters and Red Reboot destroys backrow, the second card being able to completely shut down trap relevant decks like Altergeist and Subterror.

Mind control steals monsters to handle powerfull monsters like Apollousa or at least force out négations, and Super Polymerization can neutralize boards of decks that are out of range of Nibiru. Nibiru is a stop to almost all combo decks when used at the right timing, and opens easy OTKs with Adamatia Rise Dragite.

Lastly Dinowrestler Pankratops is a free special summon that heavily pressure boards of control decks like Subterror and Altergeist with it's quick effect.

&nbsp;

This is an updated version of my Joey Wheeler Anime Themed Character Deck featuring more cards that fit his Anime deck theme from various Yugioh Sets such as Legendary Decks 2, and Legendary Duelist Joey(2017) featuring cards from the anime, movies and Manga he used. My character decks are NOT meant for Official Yugioh Tournaments. The link below shows you why his deck is built the way it is.

https://www.youtube.com/watch?v=Lsu-9GZ4j1E

&nbsp;

&nbsp;

&nbsp;

&nbsp;

&nbsp;
<p><a rel="nofollow" href="https://youtu.be/KAuLTIrgI6E">https://youtu.be/KAuLTIrgI6E</a></p>

This deck is an update and improvement to my old Danger Darkworld deck, now running a 60 card main deck, more draw power, more disruption, and a counter to nibiru.

The stat remains the same, spam out as many monsters as you can to overwhelm anything you opponent might have with high attack monsters but it can now set up a board of its own, being able to make Appaloosa, hope harbinger, and dark law turn 1 to stop anything your opponent may do

&nbsp;
